    <div className="main_div">
        <div className="center_div">
        <br/>
        <h1>Todo List</h1>
        <br/>
        <input type="text" placeholder="Add an item"/>
        <Button className="newBtn">
          <AddIcon/>
        </Button>

        <br/>
        <ol>
            <li> buy</li>
        </ol>
        <br/>
        </div>
    </div>
   </>
  );
}

